import './Services.css';

import springs from './images/springs.jpeg';
import motor from './images/motor.jpeg';

const Services = () => {
  return (
    <div className='container p-2'>

      <div className='lg:flex justify-around p-2 w-full'>
        <img className='lg:w-96 rounded-full' src={springs} alt=''></img>
        <p className='text-center'>information</p>
      </div>

      <div className='lg:flex justify-around p-2'>
        <img className='lg:w-96 rounded-full' src={motor} alt=''></img>
        <p className='text-center mt-4'>information</p>
      </div>

    </div>
  );
};


export default Services;
